<?phpnamespace Nemundo\Meteo\Dwd\Data\MapContent;class MapContentPaginationReader extends \Nemundo\Model\Reader\AbstractPaginationModelDataReader {/*** @var MapContentModel*/public $model;public function __construct() {parent::__construct();$this->model = new MapContentModel();}/*** @return MapContentRow[]*/public function getData() {$list = [];foreach (parent::getData() as $dataRow) {$row = new MapContentRow($dataRow, $this->model);$list[] = $row;}return $list;}}